def split_case_string(string, spacing):
    l = string.split(spacing)
    l_new=[]
    for i in range(len(l)):
        if "测试用例编号" in l[i]:
            l_new.append(l[i])
    return l_new

def get_case_list(string):
    if "####" in string:
        l=split_case_string(string,"####")
    elif "###" in string:
        l = split_case_string(string, "###")
    elif "##" in string:
        l = split_case_string(string, "##")
    else:
        spacing = string.split("测试用例编号")[0]
        l = split_case_string(string, spacing)
    return l
